import React, { Component } from "react";

export default class Movie extends Component {
  render() {
    const { movie } = this.props;
    return (
      <div className="col-sm-3 container movie">
        <div>
          <img src={movie.hinhAnh} alt="" />
          <div>
            <h4>{movie.tenPhim}</h4>
            <p>{movie.tenPhu}</p>
          </div>
        </div>
      </div>
    );
  }
}
